import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { NoopAnimationsModule } from '@angular/platform-browser/animations';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavBarComponent } from './nav-bar/nav-bar.component';
import { SearchFormComponent } from './search-form/search-form.component';
import { SearchComponent } from './search/search.component';
import { FlightDetailsComponent } from './search/flight-details/flight-details.component';
import { HomePageComponent } from './home-page/home-page.component';
import { HelpPageComponent } from './help-page/help-page.component';
import { MyTripsComponent } from './my-trips/my-trips.component';
import { ContactComponent } from './contact/contact.component';
import { LogInComponent } from './log-in/log-in.component';
import { SignUpComponent } from './sign-up/sign-up.component';
import { PopularDestinationsComponent } from './popular-destinations/popular-destinations.component';
import { HomepageExtraInfoComponent } from './homepage-extra-info/homepage-extra-info.component';
import { FooterComponent } from './footer/footer.component';

@NgModule({
  declarations: [
    AppComponent,
    NavBarComponent,
    SearchFormComponent,
    SearchComponent,
    FlightDetailsComponent,
    HomePageComponent,
    HelpPageComponent,
    MyTripsComponent,
    ContactComponent,
    LogInComponent,
    SignUpComponent,
    PopularDestinationsComponent,
    HomepageExtraInfoComponent,
    FooterComponent,
  ],
  imports: [BrowserModule, AppRoutingModule, CommonModule, FormsModule, BrowserAnimationsModule, NoopAnimationsModule],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
